// import appData from "../../api/appData";
import appData from "../../api/appData";
import {SIGN_UP_USER} from "../action-types";

export const signUpUser = (formValues)=>  dispatch=>{

    const  response = appData.users[formValues.email].formValues;
    dispatch({
        type:SIGN_UP_USER,
        payload:response.data
    })
};
